ガッチリつかみ、しっかり踏ん張る。「ガッチリ＆しっかりゴム」の採用で、氷上の「止まる」「曲がる」を思い通りに！DSXの優れた氷上ブレーキ性能がさらに進化した新デジタイヤスタッドレス「DSX2」<br><br>氷に強い「テトラピック」が２倍の大きさになった「ハイパーテトラピック」を配合し、ひっかき性能が向上。さらに、新素材「剛性コントロール剤」の採用により、ゴムのやわらかさと、剛性感（しっかり感）を両立。氷をガッチリつかんで、確実に止まれる性能はもちろんのこと、しっかり踏ん張って、思い通りに曲がれる性能までもが大幅に向上しました。<br><br>※販売価格はタイヤ1本の価格です。ホイールは付属しておりません。ホイールは装着イメージです。 <br><br><br>タイヤサイズ：255/40R18(255/40-18)<br><br>汎用パーツ | 汎用パーツ | 全て<br>スタッドレスタイヤ | スタッドレス/18インチ<tr><td colspan="2">
