アイスガードが、「氷に効く・永く効く・燃費に効く」という新コンセプトで生まれ変わりました。すぐれた氷上性能に加え、ころがり抵抗を低減して燃費に貢献。ヨコハマ・スタッドレスタイヤ史上最高の氷上性能にエコ性能をプラスしました。タイヤの構造を見直すことで、「アイスガード トリプル」に比べころがり抵抗を約4％低減させています。<br><br>「永く効く」では、従来より定評のあるブラックポリマーから「ブラックポリマーII」を新たに採用。一般的なオイル配合のタイヤに比べ、スタッドレスタイヤの性能を発揮するために重要なゴムの柔らかさを永く維持することができます。さらに、より低温下でもゴムの柔らかさを保ち、タイヤを路面にしっかりと接地させることに成功しました。<br><br>※販売価格はタイヤ1本の価格です。ホイールは装着イメージです。<br><br><br>タイヤサイズ：155/65R13(155/65-13)<br><br>汎用パーツ | 汎用パーツ | 全て<br>スタッドレスタイヤ | スタッドレス/13インチ<tr><td colspan="2">
